import React from "react";

const ClassCard = (props) => {
  return (
    <div class="ui cards">
      <div class="ui card" style={{ backgroundColor: "" }}>
        <hr />
        <div class="content">
          <div class="header">{props.classCode}</div>
          <div class="description">{props.classDesc}</div>
        </div>
      </div>
    </div>
  );
};

export default ClassCard;
